import React from 'react';
import Head from 'next/head';

export default class Index extends React.Component {
    render() {
        return (
            <section>
                <style jsx>
                    {`
                        
                        section {
                            background-color: #eeeeee;
                            width: 100%;
                            text-align:center;
                        }

                        section > div {
                            padding-top: 20%;
                            position:relative;
                            height:100%;
                        }

                        h1 {
                            color: #666;
                            margin:0;
                            font-size: 46px;
                        }

                        .tab {
                            background-color: #008cba;
                            height:5px;
                            width: 30px;
                            position: absolute;
                            left: 50%;
                            transform: transateX(-50%);
                        }

                        `}
                </style>
                <style jsx global>{`
                    body { 
                        margin:0;
                        padding:0;
                        font-family: Helvectica, arial, sans-serif;
                        font-weight:100;
                    }
                `}</style>

                <div>
                    <h1>Reece Russell</h1>
                    <div className="tab"></div>
                    <p>
                        Apprentice software developer
                    </p>
                </div>
            </section>
        )
    }
}
